import java.util.Scanner ; public class codeforces_148_B { public static void main ( String [ ] args ) { Scanner in = new Scanner ( System.in ) ; double VP = in.nextInt ( ) ; double VD = in.nextInt ( ) ; double T = in.nextInt ( ) ; double F = in.nextInt ( ) ; double C = in.nextInt ( ) ; if ( VD <= VP ) { System.out.println ( "0" ) ; return ; } int answer = 0 ; double start = T ; while ( true ) { double x = start * VP / ( VD - VP ) ; if ( ( start + x ) * VP >= C ) { break ; } start += 2 * x + F ; answer ++ ; } System.out.println ( answer ) ; } }
